import logo from './logo.svg';
import './App.css';
import  TestJs from './App.test';
import TextForm from './text';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <input className="mx-input" type="text"/>
      </header>
        <section className="mx-section">
            <div className="mx-main">
                <TextForm />
                <TestJs />
            </div>
        </section>
        <div className="mx-fake"></div>
        <button className="mx-new-b">new</button>
    </div>
  );
}
export default App;
